import requests 
url = 'https://api.ouraring.com/v2/usercollection/daily_activity' 
params={ 
    'start_date': '2021-11-01', 
    'end_date': '2021-12-01' 
}
headers = { 
  'Authorization': 'Bearer <token>' 
}
response = requests.request('GET', url, headers=headers, params=params) 
print(response.text)

var myHeaders = new Headers(); 
myHeaders.append('Authorization', 'Bearer <token>'); 
var requestOptions = { 
  method: 'GET', 
  headers: myHeaders, 
fetch('https://api.ouraring.com/v2/usercollection/daily_activity?start_date=2021-11-01&end_date=2021-12-01', requestOptions) 
  .then(response => response.text()) 
  .then(result => console.log(result)) 
  .catch(error => console.log('error', error));

OkHttpClient client = new OkHttpClient().newBuilder() 
  .build(); 
Request request = new Request.Builder() 
  .url("https://api.ouraring.com/v2/usercollection/daily_activity?start_date=2021-11-01&end_date=2021-12-01") 
  .method("GET", null) 
  .addHeader("Authorization", "Bearer <token>") 
  .build(); 
Response response = client.newCall(request).execute();

